--
-- Name: merged_districts; Type: TABLE; Schema: public; Owner: postgres
--

CREATE TABLE merged_districts (
    identifier character varying(4),
    bwk character varying(3),
    geom geometry,
    bezname character varying(200),
    spd bigint,
    cdu bigint,
    gruene bigint,
    fdp bigint,
    die_linke bigint,
    afd bigint
);


ALTER TABLE merged_districts OWNER TO postgres;

--
-- Name: merged_districts_diff; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW merged_districts_diff AS
 SELECT m.identifier,
        CASE
            WHEN (d.bwk IS NULL) THEN m.bwk
            ELSE d.bwk
        END AS bwk,
    m.geom,
    m.bezname,
    m.spd,
    m.cdu,
    m.gruene,
    m.fdp,
    m.die_linke,
    m.afd
   FROM (merged_districts m
     LEFT JOIN diffs d ON (((m.identifier)::text = (d.identifier)::text)));


ALTER TABLE merged_districts_diff OWNER TO postgres;

--
-- Name: counties_diff; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW counties_diff AS
 SELECT merged_districts_diff.bwk,
    st_union(merged_districts_diff.geom) AS geom,
    sum(merged_districts_diff.spd) AS spd,
    sum(merged_districts_diff.cdu) AS cdu,
    sum(merged_districts_diff.gruene) AS gruene,
    sum(merged_districts_diff.fdp) AS fdp,
    sum(merged_districts_diff.die_linke) AS die_linke,
    sum(merged_districts_diff.afd) AS afd
   FROM merged_districts_diff
  GROUP BY merged_districts_diff.bwk;


ALTER TABLE counties_diff OWNER TO postgres;

